import React from "react";
import img from '../../assets/images/homebuyer.jpe';

const divStyle = {
  width: '88%',
  height: '800px',
  backgroundImage: `url(${img})`,
  backgroundSize: 'cover'
};

const Container = ({children}) => <div className={`container`, divStyle}>{children}</div>;

export default Container;
